  \"olympic-coast-national-marine-sanctuary-hab121-0701-habitat-polygons-for-hmpr-121-2007-01-sur\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic habitat polygon coverages are being
  created for the Olympic Coast national marine sanctuary (OCNMS).ROV, towed camera
  sled, bathymetry data, sedimentary samples, and sonar mapping have been integrated
  to describe the geological, biological, and oceanographic aspects of habitat. OCNMS
  has collected side scan sonar and video data to produce polygon coverages. The habitat
  polygons have attributes for megahabitat, bottom induration, mesohabitat, macrohabitat
  and biology (where direct observations are available), polygon area and perimeter.\",\n\t\"license_title\":
